import React, { Component } from "react";
import { NavLink } from "react-router-dom";
import {Navbar, Nav} from 'react-bootstrap';

class Dashboard extends Component {
  render() {
    return (
        <Navbar bg=' blue accent-3' expand='lg'>

        {/* <Navbar.Collapse id="basic-navbar-nav"> */}
        <Nav>
            <NavLink className="d-inline p-2 bg-dark test-white" to="/">Home</NavLink>
            <NavLink className="d-inline p-2 bg-dark test-white" to="/login">Log Out</NavLink>
        </Nav>
        {/* </Navbar.Collapse> */}
        </Navbar>


    );
  }
}
export default Dashboard;
